My Pregnancy is a week-by-week pregnancy tracker. Our app will help you over the course of your pregnancy. Stay on top of the changes happening inside your body. Find out how your baby is developing.

Our app is completely free and does not contain advertising.

This app includes:
- week-by-week advice;
- useful information on fetal development and changes in your body;
- week-by-week fetal measurements and imaging;
- a to-do list for each trimester;
- a list of things you will need for hospital check-in, post-natal care and check-out;
- a weight tracker you can use to follow weight gain;
- a kick counter;
- a contraction timer;
- and much more

We have created this app with love, specially for young mothers.

This app is not intended for medical use and is not a substitute for medical consultation.

If you have any questions or requests, please write to neumandev@gmail.com. We are eager to hear your comments on how to improve the app.

Pregnant? Just track your pregnancy week by week using Pregnancy App.

With Pregnancy App you can easily: 
- track your pregnancy;
- get information about your pregnancy;
- get current pregnancy week and use pregnancy calendar;
- calculate due date (pregnancy date);
- manage contractions with contraction counter
- track kicks with kick counter
- track your pregnancy weight

Pregnancy Tracker is very helpful for a pregnant woman.
Free pregnancy app. 
Powered by Amila.

Diseases Dictionary Offline is complete OFFLINE and FREE app containing list of Medical disorders & diseases that provides all information about symptoms, disorder and treatment and many medical terminology.
This Diseases & Disorders Dictionary hand book can act as a clinical advisor for self diagnosis and can also be used to look up symptoms, diseases and treatment. Medical dictionary free download is like a FREE Doctor at home for common diseases and treatment codes.

Diseases Dictionary - Medical App Features:
1. Offline – It wok offline, no active internet connection is required;
2. Detailed description of all major medical conditions and diseases: 
- definition;
- symptoms;
- causes;
- risk factors;
- complications;
- preparing for your appointment;
- tests and diagnosis;
- treatments and drugs;
- lifestyle and home remedies

3. Easily find needed disease with instant search.
4. Favorites list– you are able to bookmark the Disease item to your favorites list by clicking on the “star” icon.

Who can use this dictionary:
Healthcare professionals, pharmaceuticals, physicians, hospital nurses, medical students, nursing professionals, pharmacy, physician assistants and for students who work in clinical practice & dispensary.

